import React, { useEffect } from "react";

const Home = () => {
  useEffect(() => {
    (async () => {
      await fetch("http://127.0.0.1:8000/api/login", {
        headers: { "Content-Type": "application/json" },
        credentials: "include",
      });
    })();
  });

  return (
    <div>
      <h1>MA IDE GAS HOME</h1>
    </div>
  );
};

export default Home;
